import React, { memo } from "react";
import { formData } from './schema';

const GetFormElement = React.lazy(() => import('component/GetFormElement'));
const Login = () => {
	console.log("Login render")
	return(
		<div className="background" style={{
			backgroundImage: `url(${process.env.PUBLIC_URL + '/static/image/bg_login.jpg'})`,
			backgroundPosition: "center",
			backgroundRepeat: "no-repeat",
			backgroundSize: "cover"
		}}>
			<div className="login-box card-shadow">
				<div className="content">
					<div style={{ display: "flex", justifyContent: "end", flexWrap: "nowrap", marginBottom: 30 }}>
						<div style={{ position: 'absolute', height: '140px', top: '10px', left: '-20px' }}>
							<img width={234} src={'static/image/prudential_logo_login.png'} alt="Logo" draggable={false} />
						</div>
						<div style={{ width: '300px' }}>
							<div style={{ fontSize: 22, textAlign: 'right' }}>Welcome To</div>
							<img width={300} src={'static/image/PRUMedicalNetwork Portal_Logo.png'} alt="Logo" draggable={false} />
						</div>
					</div>
					<div>
						{
							Object.keys(formData).map((form, formIndex) => {
								console.log(formData[form],'po')
							})
						}
					</div>
				</div>
			</div>
		</div>
	)
}

export default memo(Login, (prevProps, nextProps) => {
	return JSON.stringify(prevProps) === JSON.stringify(nextProps);
})
